import { Item, Image } from './ImageGalleryItem.styled';

export const ImageGalleryItem = ({
  id,
  webformatURL,

  tags,

  openModal,
}) => {
  return (
    <>
      <Item id={id} onClick={openModal}>
        <Image src={webformatURL} alt={tags} />
      </Item>
    </>
  );
};
